import Header from "./Header";
import Post from "./Post";
import './App.css';
import { Route, Routes } from "react-router-dom";
function App() {
  return (
    <Routes>
      <Route i element={
        <main >
          <Header />
          <Post />
          <Post />
          <Post />
        </main>}
      />
    </Routes>
  );
}

export default App;
